INSERT INTO `reviews` VALUES (25,9,2.0,300,39,6,7,0,1,0,'갑자기 가격을 올림\n방음이 잘 안됨'),(26,20,3.0,1000,50,1,7,0,0,0,''),(27,20,3.0,1000,50,2,4,0,0,0,''),(28,20,3.0,1000,50,6,10,0,0,0,''),(29,5,4.8,500,33,3,6,1,1,1,'계약 당시 저를 카페로 데려가셔서 커피를 사주시고 부모님 드리라고 쿠키도 사주셨습니다. 그리고 부동산을 통해서 안왔다고 신세계 상품권 10만원을 주셨습니다. 의심이 갈 정도로 잘해주셨습니다!\n+) 두루마루휴지30롤, 벌레퇴치제 제공'),(30,22,2.7,100,33,2,8,0,1,0,'벌레 목격 1회'),(31,13,3.0,200,35,6,4,1,0,0,''),(32,10,2.2,500,45,2,10,1,0,0,'윗집 층간소음 개심해서 집주인에게 연락함'),(33,28,4.1,500,45,6,8,0,0,1,'딱히 없습니다'),(34,6,1.8,200,32,2,8,1,1,1,'바퀴벌레 없다고 했는데 1층 계단에 있었음'),(35,19,2.8,5000,10,3,6,0,1,0,'3년째 수도꼭지 물 새는거 안 바꿔줌, 익숙해져서 그냥 삶'),(36,21,0.8,100,22,2,7,0,0,0,'벌레 없다고 에타 게시물로 홍보한 사람 말 듣고 안심하고 지냈는데 비 많이 온 날 바퀴벌레 나옴'),(37,18,3.6,300,41,3,10,0,1,0,'X'),(38,7,3.5,8000,15,3,13,0,1,0,''),(39,4,3.2,300,32,3,10,1,1,0,'방음이 잘 안 됨'),(40,23,3.8,200,30,1,10,0,1,1,'밖에서 귓속말하는것도 들리는 구조인데, 밤마다 고양이들끼리 세력다툼함 (흥미진진)'),(41,14,2.5,300,35,3,5,0,1,0,''),(42,16,2.2,200,35,3,10,0,1,0,'바퀴벌레'),(43,24,2.1,100,30,4,10,1,0,1,'매일 누가 못을 박길레 집주인께 연락드렸는데, 옥상 환풍기(무동력 벤틸레이터) 돌아가는소리였음./건너편 건물에 중국인 여성 두분이 자주싸움(그러고 극적으로 화해함)'),(44,12,3.0,300,30,2,10,1,0,0,''),(45,25,3.0,100,24,3,6,0,1,1,''),(46,27,2.4,30,35,2,5,1,1,1,'화장실 문에 방충망이 따로 없어 환풍기 겸 불을 켜두면 벌레가 항상 들어와있음'),(47,11,1.8,500,50,3,15,1,1,0,'보증금 방 뺐는데 안 줌 / 베란다 비 세는데 말 했는데 이사갈때까지 안 고쳐줌'),(48,26,4.2,400,40,4,8,1,1,0,'전등이 나갔을 때 집주인이 갈아주심'),(49,8,1.7,100,27,3,9,1,0,0,'집주인이 마스터키로 들락날락 거린다 허락도 맡지 않고...'),(50,15,3.0,450,7,3,8,0,0,0,''),(51,17,2.5,200,35,3,11,0,0,0,''),(52,29,2.9,100,25,1,8,1,0,1,'나쁘지는 않습니다. 오래된 건물과 빨간 변기 싫어하시면 안오시는 게 좋을 것 같아요. 그리마라는 벌레를 한번 보기는 하였습니다.');
